//File that creates all of the 2d arrays for my map collisions

build2darray = function(arrayin1d, dimensions){
	var result = [];
	for(var i = 0 ; i < dimensions; i++){
		result[i] = [];
		for(var j = 0 ; j < dimensions; j++){
			result[i][j] = arrayin1d[i * dimensions + j];
		}
	}
	return result;
};

createFloorObject = function(id,spawnPointX,spawnPointY,endPointID,wallID,spawnTo,grid,image){
	var self = {
	id:id,
	spawnPointX:spawnPointX,
	spawnPointY:spawnPointY,
	endPointID:endPointID,
	wallID:wallID,
	spawnTo:spawnTo,
	grid:grid,
	image:image,
	}
	return self;
}

